;; gorilla-repl.fileformat = 1

;; **
;;; # Pencil Sketch
;; **

;; **
;;; Here we are using the native opencv function named pencil-sketch. This automatically draw your picture like pencils. This gives a nice non-automatic feeling to your creations.
;; **

;; @@
(ns thoughtless-crater
    (:require
    [opencv4.core :refer :all]
    [opencv4.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; First we load the image, and then apply the pencil-sketch! function on a clone of the original picture. 
;; **

;; @@
(def original
   (-> "resources/images/cat.jpg" (imread) (u/resize-by 0.20)))
(u/mat-view original)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7f2a0848 \"BufferedImage@7f2a0848: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(-> original clone (pencil-sketch! (new-mat)) u/mat-view)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xc74a94b \"BufferedImage@c74a94b: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@414c8e6e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; The result is a bit dark, so to make the work of pencil-sketch easier and with a better result, let's apply a filter first, to highlights edges on the original picture. You'll notice a somewhat blurry effect on the picture.
;; **

;; @@
(def edge (-> original clone edge-preserving-filter!))
(u/mat-view edge)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2c032e53 \"BufferedImage@2c032e53: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Then we try again the pencil-sketch function on the filtered image.
;; **

;; @@
(-> edge clone (pencil-sketch! (new-mat)) u/mat-view)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3e840c1b \"BufferedImage@3e840c1b: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@414c8e6e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=
